// Description of |1524. Number of Sub-arrays With Odd Sum|:
//
// Given an array of integers |arr|, return the number of subarrays with an odd
// sum. Since the answer can be very large, return it modulo |10⁹ + 7|.
//
//

LEETCODE_BEGIN_RESOLVING(1524, NumberOfSubArraysWithOddSum, Solution);

class Solution {
public:
  int numOfSubarrays(vector<int> &arr) {
    const int MOD = 1e9 + 7;
    int       n   = arr.size();

    for (auto &num : arr) {
      num %= 2;
    }

    vector<int> dpEven(n), dpOdd(n);

    if (arr[n - 1] == 0) {
      dpEven[n - 1] = 1;
    } else {
      dpOdd[n - 1] = 1;
    }

    for (int num = n - 2; num >= 0; num--) {
      if (arr[num] == 1) {
        dpOdd[num]  = (1 + dpEven[num + 1]) % MOD;
        dpEven[num] = dpOdd[num + 1];
      } else {
        dpEven[num] = (1 + dpEven[num + 1]) % MOD;
        dpOdd[num]  = dpOdd[num + 1];
      }
    }

    int count = 0;
    for (auto oddCount : dpOdd) {
      count += oddCount;
      count %= MOD;
    }

    return count;
  }
};

LEETCODE_END_RESOLVING(Solution);

